import React, { useState, useEffect } from "react";

const Preview2DApi = () => {
    const [data, setData] = useState(null);
    const [error, setError] = useState(null);
    const [selectedImage, setSelectedImage] = useState("");

    useEffect(() => {
        const fetchData = async () => {
            try {
                const params = {
                    apikey: 'e66120f9d9624823884cac1bf290ea88',
                    mident: '{bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj},013 {LINEID=10}  {TYP=CYTROPAC: Hydraulic power unit},{CS=1X: Component series 10 to 19},{TS=20: 20 Litre},{DR=AF},{PC=1},{PM=AS04},{OP=2: Maximum operating pressure},{ST=E},{CT=WA},{FL=1: Return flow filter},{COL=7035: RAL 7035},{FD=UL},{PPATH=cytropac_asmtpl.prj},{BAH005=380},{AAF726=8.3},{AAB456=4000},{BAD915=AC},{AAC830=20},{BAC676=G1},{AAN523=Plug-in connection},{AAG402=1},{AAQ326=https://www.boschrexroth.com/ics/cat/?cat=Industrial-Hydraulics-Catalog&p=p943945},{AAJ413=G1},{BAI539=},{BAB706=}',
                };
                const queryString = new URLSearchParams(params).toString();
                const url = `https://webapi.partcommunity.com/service/derivationviews?${queryString}`;
                const response = await fetch(url);
                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }
                const result = await response.json();
                setData(result);
            } catch (error) {
                console.error('Error fetching the data', error);
                setError(error.message);
            }
        };

        fetchData();
    }, []); // Add an empty dependency array to call fetchData only once

    if (error) {
        return <div>Error: {error}</div>;
    }

    if (!data) {
        return <div>Loading...</div>;
    }

    const handleSelectionChange = (event) => {
        setSelectedImage(event.target.value);
    };

    return (
        <div>
            <select onChange={handleSelectionChange}>
                <option value="" disabled>Select an item</option>
                {data.views.map((item, index) => (
                    <option key={index} value={item.imageUrl}>
                        {item.name}
                    </option>
                ))}
            </select><br></br>
            {selectedImage && <img src={`https://webapi.partcommunity.com${selectedImage}`} alt="Selected item" />}
        </div>
    );
};

export default Preview2DApi;
